function onClick(e)
{
    e.preventDefault();
    grecaptcha.ready(function()
    {
        grecaptcha.execute('6Leoe-0dAAAAAAiSW0MQD01BbQ7HQXIF0NZW-gi5', {action: 'submit'}).then(function(token)
        {
            e.preventDefault(); var t = $("form.request-demo"); formValid(t)
            .done(function (e) 
            { 
                JSON.parse(e).success ? $.post("/?/requestdemo",
                {
                    firstname: t.find('[name="firstname"]').val(),
                    surname: t.find('[name="surname"]').val(),
                    email: t.find('[name="email"]').val(), 
                    phonenumber: t.find('[name="phonenumber"]').val(), 
                    position: t.find('[name="position"]').val(), 
                    country: t.find('[name="country"]').val(), 
                    company: t.find('[name="company"]').val(), 
                    nbemployees: t.find('[name="nbemployees"]').val(), 
                    comment: t.find('[name="comment"]').val(),
                    Use: t.find('[name="use"]').val()
                })
                .done(function () { location.reload() }) : alert("Please confirm you are not a robot")
            })
        });
    });
}